			:root {
				--font-body: "Minecraftia", monospace;
				--bg-color: #121212;
				--bg-secondary: #343434;
				--fg-color: #fafafa;
				--fg-secondary: #dddddd;
				--accent-color: #00d44a;
			}

			a:not([href]) {
				display: none;
			}
			* {
				font-family: var(--font-body);
				margin: 0;
				padding: 0;
				box-sizing: border-box;
			}

			h1,
			h2,
			h3,
			h4,
			h5,
			h6 {
				font-family: var(--font-display);
			}

			body {
				background-color: var(--bg-color);
				background-image: url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAMAAAAoLQ9TAAAABGdBTUEAALGPC/xhBQAAAwBQTFRFWT0peVU6dFhEbGxslmxKuYVch4eHAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQDLsGAAAAHpJREFUKFMlj4kRACEIA8MJ9l/y7aKOECHhyXRXrQm+JtWAviGITzKkeCQBoPQZSYpaVvCDMXg0XHNotypFKVsXQAO0pAQ2bZnVOCyX9qBXQbXy1S1RPVp+fW2LBx8yfOA6CZF3xl2qPis6AP1kscAO5ZYGHOP2m6LyA0AaAl8NwX0hAAAAAElFTkSuQmCC");
				background-size: 64px;
				image-rendering: pixelated;
				color: var(--fg-color);
			}

			#overlay {
				position: fixed;
				top: 0;
				left: 0;
				width: 100vw;
				height: 100vh;
				backdrop-filter: brightness(0.2);
				z-index: -1;
			}

			input[disabled] {
				opacity: 0.8;
			}
			/* ::file-selector-button, */
			progress {
				background-color: var(--bg-secondary);
				color: var(--fg-color);
				border: 1px solid var(--fg-secondary);
				border-radius: 4px;
			}

			/* ::file-selector-button {
				cursor: pointer;

				&[disabled] {
					cursor: not-allowed;
					filter: brightness(0.8);
				}
			} */

			a,
			input[type="file"] {
				color: var(--fg-color);
				transition: color 0.2s;
			}

			input[type="file"] {
				/* display: flex;
				align-items: center;
				justify-content: center;
				width: 100%; */
				display: none;
			}

			#file-label {
				cursor: pointer;
				background-color: var(--accent-color);
				color: var(--bg-color);
				padding: 0.6rem 1rem;
				font-size: 1.01rem;
				/* border-radius: 4px; */
				border: 3px outset
					color-mix(in srgb, var(--accent-color) 60%, var(--fg-color));
				transition: background-color 0.2s;

				&:hover {
					background-color: color-mix(
						in srgb,
						var(--accent-color) 80%,
						var(--fg-color)
					);
				}

				&:has(input[type="file"]:disabled) {
					background-color: var(--bg-secondary);
					color: var(--fg-secondary);
					cursor: not-allowed;

					& > #file-label-text::before {
						content: "Injecting...";
					}
				}
			}

			#file-label-text::before {
				content: "Select a .html file";
			}

			a:hover {
				color: var(--accent-color);
				transition: color 0.2s;
			}

			body {
				width: 100vw;
				height: 100vh;
				overflow: hidden;
				display: flex;
				flex-direction: column;
				justify-content: center;
				align-items: center;
				text-align: center;
			}

			#app {
				max-width: 35rem;
				margin: 0 auto;
				padding: 3rem;
				background-color: rgba(14, 12, 12, 0.8);

				display: flex;
				flex-direction: column;
				justify-content: center;
				align-items: center;
				gap: 1.5rem;
			}
		</style>

	<body>
		<div id="overlay"></div>
		<div id="app">
			<sub></sub>
			<h1>Wispcraft Injector</h1>
			<p>
				Inject WISP into your EaglercraftX 1.8 client and play on real Minecraft
				servers!
			</p>
			<label id="file-label">
				<input type="file" onchange="selectFile(this);" accept=".html,.htm" />
				<span id="file-label-text"></span>
			</label>
			<a download="wisped-eagler.html"
				>Your Wispcraft-injected Eaglercraft client is ready!</a
			>
			<span
				>A project by
				<a href="https://mercurywork.shop">Mercury Workshop</a></span
			>
			<sup>Wispcraft 1.0. (0884f3a)</sup>
		</div>
		<script>
			const downloadLink = document.querySelector("a[download]");

			function selectFile(fileElem) {
				downloadLink.removeAttribute("href");
				fileElem.disabled = true;
				if (fileElem.files.length > 0) {
					const htmlFile = fileElem.files[0];
					const reader = new FileReader();
					reader.onload = function (e) {
						const content = e.target.result;
						const parser = new DOMParser();
						const doc = parser.parseFromString(content, "text/html");
						if (!doc.head) {
							alert("Invalid client file!");
							fileElem.value = "";
							fileElem.removeAttribute("disabled");
							return;
						}
						const script = doc.createElement("script");
						script.type = "text/javascript";
						script.textContent = atob(getWispcraftBundle());
						doc.head.prepend(script);
						const finalContent = doc.documentElement.outerHTML;
						const blob = new Blob([finalContent], {
							type: "text/html; charset=utf-8",
						});
						downloadLink.download = "wispcraft-" + htmlFile.name;
						downloadLink.href = window.URL.createObjectURL(blob);
						fileElem.value = "";
						fileElem.removeAttribute("disabled");
					};
					reader.readAsText(htmlFile);
				} else {
					fileElem.removeAttribute("disabled");
				}
			}
		</script>
		<script id="wispcraft-bundled">
